    },
    "papermill": {
     "duration": 0.247217,
     "end_time": "2022-07-13T15:09:58.808051",
     "exception": false,
     "start_time": "2022-07-13T15:09:58.560834",
     "status": "completed"
    },
    "tags": []
   },
   "outputs": [],
   "source": [
    "k_clusts <- tibble(k = 1:9) %>%\n",
    "  mutate(\n",
    "    kclust = map(k, ~kmeans(food_meat, .x)),\n",
    "    tidied = map(kclust, tidy),\n",
    "    glanced = map(kclust, glance),\n",
    "    augmented = map(kclust, augment, food)\n",
    "  )"
   ]
